import * as React from 'react'
import './pageFive.css'
import Title from './components/title_bar'
import Navbar from './components/nav_bar'
import Font from './components/fnt_sze'


export default function Membership(){

    const [Lang,SetLang]=React.useState('EN')

    let LangEN,LangDE,grd_LangEN,grd_LangDE;

    if(Lang === 'EN'){
        LangEN = 'block'
        LangDE = 'none'
    } else if (Lang === 'DE'){
        LangDE='block'
        LangEN='none'       
    }

    const [Fntsze,SetFntsze]=React.useState(20)

    return(
        <div>

            <Title/>
            <Navbar onUpdate={(value:string)=>SetLang(value)} pg_Membership='4px solid red'/>

            <div className='txt_box'>
                <h1 style={{display:LangEN}}>Membership</h1>
                <h1 style={{display:LangDE}}>Mitgliedschaft</h1>

                <Font fntSlct={(sze:number)=>SetFntsze(sze)} LangEN={LangEN} LangDE={LangDE}/>

                <hr className='hr_a'></hr>

                 <p style={{fontSize:Fntsze}}>
                 At this time, the ICJ has 156 members. 

                </p>






            </div>
        </div>
    )
}
